With regard to the functional-style &quot;map&quot; function, is it really that much less typing than a simple for loop?<p><pre><code>  output := make(output_type, len(input))
  for idx, e := range(input) { output[idx] = convert(e) }
</code></pre>
compared to:<p><pre><code>  output := map(input, func(in input_type) output_type {
      return convert(in)
    }
  )
</code></pre>
